import React from 'react';

export  class DetalleProducto extends React.Component {
    render() {
        const { match } = this.props;
        return (
            < >
                <h1>Hola</h1>
                <p>{match.params.id}</p>
            </>
        );
    };
};

export default DetalleProducto;
